import React, { useState } from "react";
import { Navbar, Footer } from "./CommonUI";
import "../css/admindashboard.css";

const AdminDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isDarkMode, setIsDarkMode] = useState(false);

  // ‚úÖ Admin is logged in
  const isLoggedIn = true;

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const toggleDarkMode = () => setIsDarkMode(!isDarkMode);

  // Dummy data
  const totalUsers = 1200;
  const totalQuestions = 350;

  //dumy que 
   const dummyQuestions = [
    {
      id: 1,
      question: "What is 5 + 3?",
      options: ["6", "7", "8", "9"],
      correct: "8",
      category: "Quantitative",
    },
    {
      id: 2,
      question: "Which word is opposite of 'Happy'?",
      options: ["Sad", "Joyful", "Glad", "Pleased"],
      correct: "Sad",
      category: "Verbal",
    },
    {
      id: 3,
      question: "Which planet is known as the Red Planet?",
      options: ["Venus", "Earth", "Mars", "Jupiter"],
      correct: "Mars",
      category: "GK",
    },
    {
      id: 4,
      question: "Find the next number: 2, 4, 8, 16, ?",
      options: ["18", "20", "24", "32"],
      correct: "32",
      category: "Logical",
    },
    {
      id: 5,
      question: "What is the capital of Japan?",
      options: ["Seoul", "Beijing", "Tokyo", "Bangkok"],
      correct: "Tokyo",
      category: "GK",
    },
    {
      id: 6,
      question: "What comes next: A, C, E, G, ?",
      options: ["I", "J", "H", "K"],
      correct: "I",
      category: "Reasoning",
    },
    {
      id: 7,
      question: "Which one is a prime number?",
      options: ["4", "6", "9", "11"],
      correct: "11",
      category: "Quantitative",
    },
    {
      id: 8,
      question: "Synonym of 'Brave'?",
      options: ["Cowardly", "Courageous", "Weak", "Fearful"],
      correct: "Courageous",
      category: "Verbal",
    },
    {
      id: 9,
      question: "Which is not a programming language?",
      options: ["Python", "HTML", "C++", "Java"],
      correct: "HTML",
      category: "GK",
    },
    {
      id: 10,
      question: "If 3x = 12, what is x?",
      options: ["2", "3", "4", "6"],
      correct: "4",
      category: "Quantitative",
    },
  ];


  return (
    <div style={{ minHeight: "100vh", display: "flex", flexDirection: "column" }}>
      {/* ‚úÖ Navbar */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={isLoggedIn}
      />

      {/* Main Section */}
      <div style={{ display: "flex", flex: 1 }}>
        {/* Sidebar */}
        <div
          style={{
            width: sidebarOpen ? "220px" : "60px",
            backgroundColor: "#ffffff",
            color: "#4b0082",
            padding: "15px",
            boxSizing: "border-box",
            transition: "width 0.3s",
            borderRight: "1px solid #ddd",
          }}
        >
          <button
            onClick={toggleSidebar}
            style={{
              backgroundColor: "#103214ff",
              color: "white",
              border: "none",
              padding: "10px",
              width: "100%",
              cursor: "pointer",
              marginBottom: "20px",
              borderRadius: "5px",
            }}
          >
            {sidebarOpen ? "Close" : "‚â°"}
          </button>

          {sidebarOpen && (
            <div>
              <h4>Profile</h4>
              <p><strong>Name:</strong> Admin Name</p>
              <p><strong>Email:</strong> admin@example.com</p>
              <p><strong>Role:</strong> Admin</p>
            </div>
          )}
        </div>

        {/* Dashboard Content */}
        <div style={{ flex: 1, padding: "20px" }}>
          <h1>Admin Dashboard</h1>
          <p>
            Welcome, Admin! Here you can manage users, view reports, and handle
            system settings.
          </p>

          {/* üìä Overview Dashboard */}
          <section className="overview-section">
            <h2>üìä Overview Dashboard</h2>
            <div className="overview-cards">
              <div className="card">
                <h3>Total Users Registered</h3>
                <p>{totalUsers}</p>
              </div>
              <div className="card">
                <h3>Total Questions</h3>
                <p>{totalQuestions}</p>
              </div>
            </div>
          </section>

          {/* üßë‚Äçüè´ Question Management */}
          <section className="management-section">
            <h2>üßë‚Äçüè´ Question Management</h2>
            <ul>
              <li>Add / Edit / Delete questions</li>
              <li>
                Categorize by topic: Quantitative, Logical, Verbal, GK, Reasoning
              </li>
              <li>Upload questions via Excel or CSV file</li>
            </ul>
          </section>
        </div>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default AdminDashboard;
